selector_to_html = {"a[href=\"#equation-eq-lec5-ex0-sol-complementary-sensitivity\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec5-ex0-sol-complementary-sensitivity\">\n\\[\\begin{split}\n\\lvert T(i \\omega) \\lvert_{\\text{dB}} \\approx \\begin{dcases}\n    0 \\text{ dB } &amp; \\text{where } \\lvert G_o (i \\omega)\\lvert_{\\text{dB}} &gt; 0dB \\\\\n    \\lvert G_o(i \\omega) \\lvert_{\\text{dB}} &amp;  \\text{where }  \\lvert G_o (i \\omega)\\lvert_{\\text{dB}} &lt; 0dB\n\\end{dcases}\n\\end{split}\\]</div>", "a[href=\"#step-response-simulations\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Step response simulations<a class=\"headerlink\" href=\"#step-response-simulations\" title=\"Link to this heading\">#</a></h4><p>We can illustrate this trade-off by simply simulating the closed-loop acheived by <span class=\"math notranslate nohighlight\">\\(F(s) = 0.44\\)</span> and by <span class=\"math notranslate nohighlight\">\\(F(s) = \\frac{20}{s + 20}\\)</span>, when</p>", "a[href=\"#fig-lec5-ex0-sol-bode\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex0-sol-bode\">\n<a class=\"reference internal image-reference\" href=\"../_images/de2e021ab8129662912fe1a79f901d2c7452f0441b71cf496cb62ac5fe2f1ddd.png\"><img alt=\"../_images/de2e021ab8129662912fe1a79f901d2c7452f0441b71cf496cb62ac5fe2f1ddd.png\" src=\"../_images/de2e021ab8129662912fe1a79f901d2c7452f0441b71cf496cb62ac5fe2f1ddd.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 33 </span><span class=\"caption-text\">Magnitude Bode plot of <span class=\"math notranslate nohighlight\">\\(G(s)\\)</span></span><a class=\"headerlink\" href=\"#fig-lec5-ex0-sol-bode\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p>Let\u2019s sart by observing that an attenuation factor of <span class=\"math notranslate nohighlight\">\\(10\\)</span> corresponds to <span class=\"math notranslate nohighlight\">\\(\\lvert T(i 50) \\lvert_{dB }= -20\\)</span> dB. From the sketch of complementary sensitivity for <span class=\"math notranslate nohighlight\">\\(K=1\\)</span> in <a class=\"reference internal\" href=\"#fig-lec5-ex0-sol-compsens-1\"><span class=\"std std-numref\">Fig. 34</span></a>, we can note that</p>", "a[href=\"#solutions-of-exercise-5-0\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 5.0<a class=\"headerlink\" href=\"#solutions-of-exercise-5-0\" title=\"Link to this heading\">#</a></h1><p>Consider the control system in <a class=\"reference internal\" href=\"#fig-lec-ex0-sol-block\"><span class=\"std std-numref\">Fig. 32</span></a>, where <span class=\"math notranslate nohighlight\">\\(n(t)\\)</span> is the sinusoidal measurement noise <span class=\"math notranslate nohighlight\">\\(n(t) = \\sin(50 t)\\)</span>.</p>", "a[href=\"#fig-lec5-ex0-sol-compsens-1\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex0-sol-compsens-1\">\n<a class=\"reference internal image-reference\" href=\"../_images/6352a966664c72b61960173c046789e6a8980141ec3f3dacaa40e97cd0930b6b.png\"><img alt=\"../_images/6352a966664c72b61960173c046789e6a8980141ec3f3dacaa40e97cd0930b6b.png\" src=\"../_images/6352a966664c72b61960173c046789e6a8980141ec3f3dacaa40e97cd0930b6b.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 34 </span><span class=\"caption-text\">Magnitude Bode plot of <span class=\"math notranslate nohighlight\">\\(G_o(s)= G(s)\\)</span> and <span class=\"math notranslate nohighlight\">\\(T(s) for \\)</span>K=1$</span><a class=\"headerlink\" href=\"#fig-lec5-ex0-sol-compsens-1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>We can easily compute <span class=\"math notranslate nohighlight\">\\(\\lvert T(i 50) \\lvert_{\\text{dB}}\\)</span> using the sketching rule <a class=\"reference internal\" href=\"#equation-eq-lec5-ex0-sol-complementary-sensitivity\">(14)</a>. Note that in this case we do have the Bode plot of <span class=\"math notranslate nohighlight\">\\(\\lvert G_o(i \\omega) \\lvert\\)</span>: it is the same as the Bode plot og <span class=\"math notranslate nohighlight\">\\(G(i \\omega)\\)</span> because <span class=\"math notranslate nohighlight\">\\(K=1\\)</span>.</p><p>Doing so, we obtain the Bode plot in <a class=\"reference internal\" href=\"#fig-lec5-ex0-sol-compsens-1\"><span class=\"std std-numref\">Fig. 34</span></a>.</p>", "a[href=\"#analytical-solutions\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Analytical solutions<a class=\"headerlink\" href=\"#analytical-solutions\" title=\"Link to this heading\">#</a></h3><p>Let us derive the analytical expression of the complementary sensitivity at <span class=\"math notranslate nohighlight\">\\(50\\)</span> rad/s, as a function of the proportional controller gain <span class=\"math notranslate nohighlight\">\\(K\\)</span>:</p>", "a[href=\"#id1\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h4><p>We need to compute for what values of <span class=\"math notranslate nohighlight\">\\(K\\)</span> <a class=\"reference internal\" href=\"#equation-eq-lec5-ex0-sol-t-modulus\">(15)</a> is smaller than <span class=\"math notranslate nohighlight\">\\(0.1\\)</span>, so that the attenuation factor is (at least) <span class=\"math notranslate nohighlight\">\\(10\\)</span>. This inequality is really nasty, because if we try to evaluate the squares a fourth order term <span class=\"math notranslate nohighlight\">\\(K^4\\)</span> appears. Instead of solving it explicitly, we can try probing different values of <span class=\"math notranslate nohighlight\">\\(K\\)</span> to numerically find one that makes <span class=\"math notranslate nohighlight\">\\(\\lvert T(i 50) \\lvert \\approx 0.1\\)</span>. Note that the calculation of <span class=\"math notranslate nohighlight\">\\(\\lvert T(i 50) \\lvert\\)</span> for different values of <span class=\"math notranslate nohighlight\">\\(K\\)</span> can be easily automated with a programmable calculator!</p>", "a[href=\"#question-3\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3<a class=\"headerlink\" href=\"#question-3\" title=\"Link to this heading\">#</a></h3><p>We now use the controller <span class=\"math notranslate nohighlight\">\\(F(s) = \\frac{\\alpha}{s + \\alpha}\\)</span>. Let\u2019s start by noting that the static gain of this controller is <span class=\"math notranslate nohighlight\">\\(1\\)</span>. In fact, it can be re-written as</p>", "a[href=\"#fig-lec5-ex0-sol-step-response\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex0-sol-step-response\">\n<a class=\"reference internal image-reference\" href=\"../_images/413e3618f7504530f6a51ae44c4e0c960a2a45850ffe50a2c5176112096eafb4.png\"><img alt=\"../_images/413e3618f7504530f6a51ae44c4e0c960a2a45850ffe50a2c5176112096eafb4.png\" src=\"../_images/413e3618f7504530f6a51ae44c4e0c960a2a45850ffe50a2c5176112096eafb4.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 38 </span><span class=\"caption-text\">Closed-loop step response for design 1 (<span class=\"math notranslate nohighlight\">\\(F(s)=0.44\\)</span>) and design 2 (<span class=\"math notranslate nohighlight\">\\(F(s) = \\frac{\\alpha}{s + \\alpha}\\)</span>) with and without the noise <span class=\"math notranslate nohighlight\">\\(n(t).\\)</span></span><a class=\"headerlink\" href=\"#fig-lec5-ex0-sol-step-response\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#question-1-k-1\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1 - <span class=\"math notranslate nohighlight\">\\(K=1\\)</span><a class=\"headerlink\" href=\"#question-1-k-1\" title=\"Link to this heading\">#</a></h4><p>To solve Question 1, we just replace <span class=\"math notranslate nohighlight\">\\(K=1\\)</span> in <a class=\"reference internal\" href=\"#equation-eq-lec5-ex0-sol-t-modulus\">(15)</a>. Doing so, we obtain:</p>", "a[href=\"#fig-lec5-ex0-sol-compsens-alpha-20\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex0-sol-compsens-alpha-20\">\n<a class=\"reference internal image-reference\" href=\"../_images/2ddfcfa087e95c8b0871800a2502cb9bdcc462d7eee59f395e7399f111f2abf0.png\"><img alt=\"../_images/2ddfcfa087e95c8b0871800a2502cb9bdcc462d7eee59f395e7399f111f2abf0.png\" src=\"../_images/2ddfcfa087e95c8b0871800a2502cb9bdcc462d7eee59f395e7399f111f2abf0.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 37 </span><span class=\"caption-text\">Magnitude Bode plot of <span class=\"math notranslate nohighlight\">\\(G_o(s)= \\frac{\\alpha}{s + \\alpha} G(s)\\)</span> and <span class=\"math notranslate nohighlight\">\\(T(s)\\)</span> for <span class=\"math notranslate nohighlight\">\\(\\alpha = 20\\)</span></span><a class=\"headerlink\" href=\"#fig-lec5-ex0-sol-compsens-alpha-20\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#equation-eq-lec5-ex0-sol-t-modulus\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec5-ex0-sol-t-modulus\">\n\\[\n\\lvert T(i50) \\lvert = \\sqrt{\\left( \\frac{100K^2 + 10K}{(10K +1)^2 + 50^2} \\right)^2 + \\left( \\frac{500K}{(10K +1)^2 + 50^2} \\right)^2}\n\\]</div>", "a[href=\"#fig-lec-ex0-sol-block\"]": "<figure class=\"align-default\" id=\"fig-lec-ex0-sol-block\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex0-block.svg\"><img alt=\"../_images/ex0-block.svg\" src=\"../_images/ex0-block.svg\" style=\"width: 600px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 32 </span><span class=\"caption-text\">Block diagram of the control system</span><a class=\"headerlink\" href=\"#fig-lec-ex0-sol-block\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#fig-lec5-ex0-sol-compsens-2\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex0-sol-compsens-2\">\n<a class=\"reference internal image-reference\" href=\"../_images/c958acef1e049879da375483a1a0080f448479bf8d4d2da16b81a416a0d61df9.png\"><img alt=\"../_images/c958acef1e049879da375483a1a0080f448479bf8d4d2da16b81a416a0d61df9.png\" src=\"../_images/c958acef1e049879da375483a1a0080f448479bf8d4d2da16b81a416a0d61df9.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 35 </span><span class=\"caption-text\">Magnitude Bode plot of <span class=\"math notranslate nohighlight\">\\(G_o(s)= G(s)\\)</span> and <span class=\"math notranslate nohighlight\">\\(T(s)\\)</span> for <span class=\"math notranslate nohighlight\">\\(K=0.44\\)</span></span><a class=\"headerlink\" href=\"#fig-lec5-ex0-sol-compsens-2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#fig-lec5-ex0-sol-compsens-alpha-10\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex0-sol-compsens-alpha-10\">\n<a class=\"reference internal image-reference\" href=\"../_images/5ebfe5d090591433a5e0f572ee10cb34100b0456868a5397170894490c8d93d3.png\"><img alt=\"../_images/5ebfe5d090591433a5e0f572ee10cb34100b0456868a5397170894490c8d93d3.png\" src=\"../_images/5ebfe5d090591433a5e0f572ee10cb34100b0456868a5397170894490c8d93d3.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 36 </span><span class=\"caption-text\">Magnitude Bode plot of <span class=\"math notranslate nohighlight\">\\(G_o(s)= \\frac{\\alpha}{s + \\alpha} G(s)\\)</span> and <span class=\"math notranslate nohighlight\">\\(T(s)\\)</span> for <span class=\"math notranslate nohighlight\">\\(\\alpha = 10\\)</span></span><a class=\"headerlink\" href=\"#fig-lec5-ex0-sol-compsens-alpha-10\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><p>From Lecture 7, we know that the transfer function between the noise <span class=\"math notranslate nohighlight\">\\(N(s)\\)</span> and the output <span class=\"math notranslate nohighlight\">\\(Y(s)\\)</span> is the <strong>complementary sensitivity function</strong> <span class=\"math notranslate nohighlight\">\\(T(s)\\)</span></p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
